import {
    BrowserRouter,
    Routes,
    Route
} from 'react-router-dom'
import UserItem from '../UserItem'

const Router=()=>{
    return(
        <>
            
            <BrowserRouter>
                    <UserItem></UserItem>
                    <Routes>
                        <Route exact path="/body" element={<UserDetailBody></UserDetailBody>}></Route>
                    </Routes>
            </BrowserRouter>
        </>
    )
}
export default Router
